DROP TABLE `waz_location`;

CREATE TABLE `waz_location` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `loc_reference` varchar(15) default NULL,
  `loc_agent` varchar(255) default NULL,
  `loc_prix` varchar(100) default NULL,
  `loc_date_debut` varchar(255),
  `loc_date_fin` varchar(255),
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

